import React, { useState } from "react";
import { Container, Row } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import Card from "react-bootstrap/Card";
import Alert from "react-bootstrap/Alert";
// import { addVictimsApi } from "../../services/api";

const InitialValues = {
  vfirstName: "",
  vlastName: "",
  vMobno: "",
  vAddress: "",
  vCity: "",
  vEmail: "",
  vUserName: "",
  vPassword: "",
  vRePassword: "",
};

export default function VictimsRegistration() {
  const [victim, setVictim] = useState(InitialValues);

  const onValueChange = (e) => {
    console.log(e.target.name, e.target.value);
    setVictim({ ...victim, [e.target.name]: e.target.value });
    console.log(victim);
  };

  const addVictims = async () => {
    // await addVictimsApi(victim);
  };
  const styles = {
    cardstyle: {
      width: "35rem",
      marginBottom: "20rem",
    },
  };
  return (
    <div>
      <Container fluid className="w-55" bg="secondary">
        <Form>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Victims First Name
            </Form.Label>

            <Form.Control
              type="text"
              placeholder="Enter First Name"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vfirstName"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Victims Last Name
            </Form.Label>

            <Form.Control
              type="text"
              placeholder="Enter Last Name"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vlastName"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Mobile No
            </Form.Label>

            <Form.Control
              type="number"
              placeholder="Enter mobile number"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vMobno"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Address
            </Form.Label>

            <Form.Control
              type="text"
              placeholder="Enter your address"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vAddress"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              City
            </Form.Label>

            <Form.Control
              type="text"
              placeholder="Enter city Name"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vCity"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Email Address
            </Form.Label>

            <Form.Control
              type="email"
              placeholder="Enter your email address here"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vEmail"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              User Name
            </Form.Label>

            <Form.Control
              type="text"
              placeholder="Enter User Name"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vUserName"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Password
            </Form.Label>

            <Form.Control
              type="password"
              placeholder="enter password"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vPassword"
            />
          </Form.Group>
          <Form.Group as={Row} className="mb-3" controlId="formBasicEmail">
            <Form.Label column sm={2}>
              Re-Enter Password
            </Form.Label>

            <Form.Control
              type="password"
              placeholder="re-enter password"
              style={{ width: "25%" }}
              onChange={(e) => onValueChange(e)}
              name="vRePassword"
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicCheckbox">
            <Form.Check type="checkbox" label="Accept Terms & Check me out" />
          </Form.Group>
          <Button
            onClick={() => addVictims()}
            variant="outline-success"
            type="submit"
          >
            Register As Victim
          </Button>
          <Button variant="outline-success" type="reset">
            Reset Values
          </Button>
        </Form>
      </Container>
    </div>
  );
}
